            attributes: {
              artistBio:
                "Moby has worn many hats through his career, including DJ, producer, restaurateur, author, and activist. Born in New York City in 1965, Richard Melville Hall began his music career in punk bands, but his interests shifted to electronic music while he was in college. His 1990 debut single, “Mobility,” was followed by a slew of tracks that hit big on the club circuit, and in 1995 he released his major-label debut, <I>Everything Is Wrong</I>, a spirited, genre-melding, home-studio-recorded tour de force that made him the American face of electronic music. In 1999, Moby experienced a massive mainstream breakthrough with <I>Play</I>, a melding of blues and folk with plush electronics and big beats that became the soundtrack for commercials as well as low-lit lounges around the world. In the years that followed, Moby would refine and expand on his sound with albums like 2009’s downcast <I>Wait for Me</I> and 2016’s bedtime-ready <I>Long Ambients 1: Calm. Sleep</I>; he also campaigned for animal rights, opened restaurants in New York and Los Angeles, and published two memoirs.",
              genreNames: ["Electronic"],
              name: "Moby",
            },
