            attributes: {
              artistBio:
                "Dimitri Vegas & Like Mike's journey from club and festival regulars to world-conquering arena-fillers occurred alongside EDM's rise to global domination. Indeed, this sibling duo's DJ sets and productions have served as rocket fuel for the dance-music phenomenon since the early 2000s. Raised in Belgium in a Greek family under the less flashy names of Dimitri Thivaios (born 1982) and Michael Thivaios (born 1985), Dimitri Vegas and Like Mike began their careers behind the decks while still teenagers. In 2010, their propulsive yet melodic brand of EDM went overground with \"Tomorrow (Give in to the Night),\" a track that forged their long relationship with Belgium's Tomorrowland festival. In the years to come, the duo's superstar status in the European dance-music scene led to collaborations with the likes of Wiz Khalifa on 2018's \"When I Grow Up,\" and David Guetta and Daddy Yankee on 2019's \"Instagram,\" as well as remixes for Lady Gaga, The Weeknd, and many more acts who benefitted from Dimitri Vegas & Like Mike's flair for exuberance. ",
              genreNames: ["Dance"],
              name: "Dimitri Vegas & Like Mike",
            },
