            avatar:
              "https://is1-ssl.mzstatic.com/image/thumb/Features125/v4/a2/2d/df/a22ddf71-9254-043c-c162-11fbc25c5ff3/mzl.ilbjswky.jpg/440x440bb.jpg",
            attributes: {
              artistBio:
                "Dozens of British artists share Adele’s origins—BRIT School, Myspace, pop stardom—but it takes rare talent to have your voice declared timeless in your career’s first flush. Adele Adkins honed hers as a kid in her North London bedroom, imitating Etta James every night for an hour. But as soon as she made her television debut at age 19 in 2007, all potential comparisons evaporated: This girl with whopping hoop earrings and a pub landlady’s brashness had something unique. Heartbreak, indignation, and regret all found a natural home in her regal mezzo-soprano, the instrument that powered her 2008 debut album, <i>19</i>, and took influence from the American South on 2011’s <i>21</i>. Both of these albums broke records for breaking records, which made a subsequent operation on Adele’s vocal cords a matter of global import. She recovered immaculately—for proof, watch her performance of “Rolling in the Deep” at the 2012 Grammys—and it took just one word to reintroduce her in 2015. “Hello,” she sang during an <i>X Factor</i> ad break, unveiling her third album, <i>25</i>, in the process. Songs like the swirling “Send My Love (To Your New Lover)” and the pensive “Water Under the Bridge” helped it become yet another global chart-topper. In 2021, Adele released <i>30</i>, which grappled with motherhood, the aftermath of her divorce, and—perhaps most surprisingly—happiness amid life’s upheavals. She embarked on a Las Vegas residency in 2022, showcasing her formidable catalog and era-defining voice.",
              genreNames: ["Pop"],
              name: "Adele",
            },
